import React, { useState, useEffect, useMemo } from 'react';
import { Calendar, momentLocalizer } from 'react-big-calendar';
import moment from 'moment';
import 'react-big-calendar/lib/css/react-big-calendar.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useNavigate } from 'react-router-dom';
import { Routes, Route, useParams } from 'react-router-dom';

const localizer = momentLocalizer(moment);

function App() {
  const [bookedSlots, setBookedSlots] = useState({});
  const [currentDate, setCurrentDate] = useState(new Date());
  const navigate = useNavigate();

  // Simulated API call for booked slots
  useEffect(() => {
    const mockData = {
      '2025-02-15': ['10:00', '14:30'],
      '2025-02-20': ['09:30', '13:00'],
    };
    setBookedSlots(mockData);
  }, []);

  // Convert booked slots into events
  const events = useMemo(() => {
    return Object.entries(bookedSlots).flatMap(([date, times]) =>
      times.map((time) => {
        const start = moment(`${date} ${time}`, 'YYYY-MM-DD HH:mm').toDate();
        const end = moment(start).add(1, 'hour').toDate();
        return { title: 'Booked', start, end, allDay: false };
      })
    );
  }, [bookedSlots]);

  // Handle selecting a time slot
  const handleSelectSlot = ({ start }) => {
    const dateStr = moment(start).format('YYYY-MM-DD');
    const timeStr = moment(start).format('HH:mm');

    if (bookedSlots[dateStr]?.includes(timeStr)) {
      alert(`❌ ${timeStr} on ${dateStr} is already booked!`);
      return;
    }

    alert(`✅ Booking request for ${dateStr} at ${timeStr}`);
    navigate(`/booking/${dateStr}/${timeStr}`);
  };

  return (
    <div className="App container mt-5">
      <header className="text-center mb-4">
        <h1>Booking Calendar</h1>
      </header>

      <div className="card shadow">
        <div className="card-body">
          <Calendar
            localizer={localizer}
            events={events}
            startAccessor="start"
            endAccessor="end"
            selectable
            onSelectSlot={handleSelectSlot}
            date={currentDate}
            onNavigate={(date) => setCurrentDate(date)}
            defaultView="week"
            views={['month', 'week', 'day']}
            step={30} // 30-minute slots
            timeslots={2} // Each cell = 1 hour
            style={{ height: '70vh' }}
            eventPropGetter={() => ({ style: { backgroundColor: 'red', color: 'white' } })}
          />
        </div>
      </div>
    </div>
  );
}

function BookingForm() {
  const { date, time } = useParams();
  const navigate = useNavigate();

  return (
    <div className="container mt-5">
      <div className="card shadow-lg">
        <div className="card-body">
          <h2 className="text-center mb-4">Booking Form</h2>
          <p className="text-center">You've selected: <strong>{date}</strong> at <strong>{time}</strong></p>

          <form>
            <div className="mb-3">
              <label className="form-label">Your Name</label>
              <input type="text" className="form-control" placeholder="Enter your name" required />
            </div>

            <div className="mb-3">
              <label className="form-label">Email</label>
              <input type="email" className="form-control" placeholder="Enter your email" required />
            </div>

            <div className="mb-3">
              <label className="form-label">Phone Number</label>
              <input type="tel" className="form-control" placeholder="Enter your phone number" required />
            </div>

            <div className="d-flex justify-content-between">
              <button type="submit" className="btn btn-success">Submit Booking</button>
              <button type="button" className="btn btn-secondary" onClick={() => navigate('/')}>
                Back to Calendar
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}

// Routes Configuration
function RoutesComponent() {
  return (
    <Routes>
      <Route path="/" element={<App />} />
      <Route path="/booking/:date/:time" element={<BookingForm />} />
    </Routes>
  );
}

export default RoutesComponent;
